"""Упорядоченные дроби
Рассмотрим дробь n/d, где n и d являются натуральными числами. Если n<d и НОД(n,d) = 1,
то речь идет о сокращенной правильной дроби.

Если перечислить множество сокращенных правильных дробей для d ≤ 8 в порядке возрастания их значений, получим:

1/8, 1/7, 1/6, 1/5, 1/4, 2/7, 1/3, 3/8, 2/5, 3/7, 1/2, 4/7, 3/5, 5/8, 2/3, 5/7, 3/4, 4/5, 5/6, 6/7, 7/8

Нетрудно заметить, что дробь 2/5 расположена непосредственно слева от дроби 3/7.

Перечислив множество сокращенных правильных дробей для d ≤ 1 000 000 в порядке возрастания их
значений, найдите числитель дроби, расположенной непосредственно слева от дроби 3/7."""

import time
from decimal import Decimal
from math import *
from fractions import Fraction

def evklid_NOD(a,b):
    while a != 0 and b != 0:
        if a > b:
            a = a % b
        else:
            b = b % a
    return a + b

start = time.time()
t = Fraction(3, 7)

etalon= float(Fraction(3, 7))
print(etalon)
print(float(Fraction(2, 5)))
print(float(Fraction(3, 8)))
a_in = 10000
print("Шаг 1")
res = list()
for d in range(1, a_in + 1):
	print(d)
	#b = (n for n in range(1, d) if gcd(n, d) == 1)
	b = (n for n in range(1, d) if evklid_NOD(n, d) == 1) # Генерируем числители


	#c = (Fraction(n, d) for n in b if etalon - 0.001 < float(Fraction(n, d)) <= etalon)
	c = (Fraction(n, d) for n in b if 0.4280 < float(Fraction(n, d)) < etalon)
	res += c
print(f"Длиинна списка {len(res)}") #Длиинна списка 2855 при 0.42850
answ = sorted(res)[::-1]
print("Шаг 2")
answer = answ[:10]
print("Шаг 3")


